    // ============ 햒햑햊햍햊햑햚 햆햍햞 먫냻놣뤯뭻 햐 햕햇햏햃햎햊 ============
    const PriceUtils = {
        // 쮏혞혢햦혝혧 혜햦혜쮏 쒬햣혠 햣햡햦쮏쫧쮏 (쮐혜쮐혝햦쮏쒫썛쫧쫨햧)
        getRegions: function() {
            return Object.keys(priceData).sort((a, b) => {
                // 햦쮐햦혝햣혝 햢햩혪 쮐햫쮏쒫쫨혠 햣햡햦쮏쫧쮏
                const priority = {
                    "햎쮐햨쒫": 1,
                    "햎쮐햨쮏쒬햨햟혪 쮏쐃햟혜혝혧": 2,
                    "햐햟햫햨혝-햣혝햣햠혞햡": 3,
                    "햍햣햫햦햫햡햟햢혜햨햟혪 쮏쐃햟혜혝혧": 4
                };
                
                if (priority[a] && priority[b]) return priority[a] - priority[b];
                if (priority[a]) return -1;
                if (priority[b]) return 1;
                return a.localeCompare(b);
            });
        },
        
        // 쮏혞혢햦혝혧 햟향햪햣혦 햢햩혪 햣햡햦쮏쫧
        getSizes: function(region) {
            if (!priceData[region]) return [];
            return Object.keys(priceData[region]).sort((a, b) => {
                const aNum = parseInt(a.replace(/[^\d]/g, ''));
                const bNum = parseInt(b.replace(/[^\d]/g, ''));
                return aNum - bNum;
            });
        },
        
        // 쮏혞혢햦혝혧 햣햦쮏얧쟴햫쮐혝혧 햢햩혪 햣햡햦쮏쫧 햦 햟향햪햣햟
        getFrequencies: function(region, size) {
            if (!priceData[region] || !priceData[region][size]) return [];
            return Object.keys(priceData[region][size]).sort();
        },
        
        // 쮏혞혢햦혝혧 혡햣햫혞
        getPrice: function(region, size, frequency) {
            if (!priceData[region] || !priceData[region][size] || !priceData[region][size][frequency]) {
                return 0;
            }
            return priceData[region][size][frequency];
        },
        
        // 먫썜혜혢햦혝햟혝혧 혜혝쮏쟳쨿쮐혝혧 향햟 햪햣혜혪혡
        calculateMonthly: function(region, size, frequency, quantity = 1) {
            const price = this.getPrice(region, size, frequency);
            if (price === 0) return 0;
            
            const replacements = {
                "1 햟향  햢쒫 햫햣햢햣햩햦": 2,
                "1 햟향  햫햣햢햣햩혩": 4,
                "2 햟향햟  햫햣햢햣햩혩": 8,
                "3 햟향햟  햫햣햢햣햩혩": 12,
                "4 햟향햟  햫햣햢햣햩혩": 16,
                "5 햟향  햫햣햢햣햩혩": 20,
                "6 햟향  햫햣햢햣햩혩": 24,
                "7 햟향  햫햣햢햣햩혩": 28
            };
            
            const count = replacements[frequency] || 4;
            return price * count * quantity;
        },
        
        // 햓쮐햪햟혝햦쮏쒫썜혧 혡햣햫혞
        formatPrice: function(price) {
            return new Intl.NumberFormat('ru-RU', {
                style: 'currency',
                currency: 'RUB',
                minimumFractionDigits: 0,
                maximumFractionDigits: 0
            }).format(price);
        },
        
        // 쮏쟴햨  햣햡햦쮏쫨
        findRegion: function(query) {
            query = query.toLowerCase();
            const regions = this.getRegions();
            return regions.filter(r => r.toLowerCase().includes(query));
        }
    };
    
    // ============ 햜햌햐뤯먫 ============
    window.priceData = priceData;
    window.PriceUtils = PriceUtils;
    
    // 쮏얨혢햣혝 혜혝햟혝햦혜혝햦햨햦
    const totalRegions = PriceUtils.getRegions().length;
    let totalPositions = 0;
    Object.keys(priceData).forEach(region => {
        Object.keys(priceData[region]).forEach(size => {
            totalPositions += Object.keys(priceData[region][size]).length;
        });
    });
    
    console.log(`游늵 행햟햡혞햤햣햫 햣햡햦쮏쫧쮏: ${totalRegions}`);
    console.log(`游닍 뉌햣햡 쮏햦혡햦햧: ${totalPositions}`);
    console.log(`游댌 햣쒬햣 5 햣햡햦쮏쫧쮏: ${PriceUtils.getRegions().slice(0, 5).join(', ')}`);
    
